import React from 'react'
import { Doughnut } from 'react-chartjs-2'

const WinningPercentage = () => (
    <div>
      <Doughnut
        data={[10, 20, 30]}
        width={750}
        height={500}
        options={{
          title: {
            display: true,
            text: `Spending Categories in ${this.props.currentMonth}`,
            fontsize: 200
          },
          legend: {
            display: true,
            position: "bottom"
          }
        }}
      />
    </div>
  )


export default WinningPercentage
